
-- =======================
-- Drop existing tables
-- =======================
DROP TABLE IF EXISTS survey_results CASCADE;
DROP TABLE IF EXISTS event_registrations CASCADE;
DROP TABLE IF EXISTS donations CASCADE;
DROP TABLE IF EXISTS milestones CASCADE;
DROP TABLE IF EXISTS events CASCADE;
DROP TABLE IF EXISTS event_types CASCADE;
DROP TABLE IF EXISTS participants CASCADE;
DROP TABLE IF EXISTS users CASCADE;

-- =======================
-- 1. users
-- =======================
CREATE TABLE users
    user_id                    INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    participant_email                 VARCHAR(255),
    participant_first_name            VARCHAR(100),
    participant_last_name             VARCHAR(100),
    participant_dob                   DATE,
    participant_role                  VARCHAR(100),
    participant_phone                 VARCHAR(50),
    participant_city                  VARCHAR(100),
    participant_state                 VARCHAR(50),
    participant_zip                   VARCHAR(20),
    participant_school_or_employer    VARCHAR(255),
    participant_field_of_interest     VARCHAR(255),
    total_donations                   NUMERIC(12,2),
    participant_username              VARCHAR(100),
    participant_password              VARCHAR(255)
);

-- =======================
-- 2. event_types
-- =======================
CREATE TABLE event_types (
    event_type_id            INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    event_name               VARCHAR(255),
    event_type               VARCHAR(100),
    event_description        TEXT,
    event_recurrence_pattern VARCHAR(100),
    event_default_capacity   INTEGER
);

-- =======================
-- 3. events
-- =======================
CREATE TABLE events (
    event_id                         INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    event_type_id                    INTEGER ,
    event_name                       VARCHAR(255),
    event_date                       DATE,
    event_start_time                 TIME,
    event_end_time                   TIME,
    event_location                   VARCHAR(255),
    event_capacity                   INTEGER,
    registration_deadline_date       DATE,
    registration_deadline_time       TIME
);

-- =======================
-- 4. event_registrations
-- =======================
CREATE TABLE event_registrations (
    event_registration_id       INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    user_id              INTEGER ,
    event_id                    INTEGER ,
    registration_status         VARCHAR(50),
    registration_attended_flag  INTEGER,
    registration_created_at_date DATE,
    registration_created_at_time TIME,
    registration_check_in_date   DATE,
    registration_check_in_time   TIME
);

-- =======================
-- 5. donations
-- =======================
CREATE TABLE donations (
    donation_id      INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    user_id   INTEGER ,
    donation_date    DATE,
    donation_amount  NUMERIC(10,2)
);

-- =======================
-- 6. milestones
-- =======================
CREATE TABLE milestones (
    milestone_id       INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    user_id     INTEGER ,
    milestone_title    VARCHAR(255),
    milestone_date     DATE,
    milestone_category VARCHAR(100)
);

-- =======================
-- 7. survey_results
-- =======================
CREATE TABLE survey_results (
    survey_id                    INTEGER GENERATED ALWAYS AS IDENTITY PRIMARY KEY,
    event_registration_id        INTEGER ,
    survey_satisfaction_score    NUMERIC(4,2),
    survey_usefulness_score      NUMERIC(4,2),
    survey_instructor_score      NUMERIC(4,2),
    survey_recommendation_score  NUMERIC(4,2),
    survey_overall_score         NUMERIC(4,2),
    survey_nps_bucket            VARCHAR(20),
    survey_comments              TEXT,
    submission_date              DATE,
    submission_time              TIME
);


